import React from "react";
import "./App.css";
import Comments from "./Comments"


function WorkoutCard ( {workout, selectedPlayer} ) {

    const {workout_type, date, details, approx_duration} = workout

    return (
        <div>
            <h4>{date}</h4>
            <h3>{workout_type}</h3>
            <p>{details}</p>
            <p>{approx_duration}</p>
            <Comments/>

        </div>
    )
}

export default WorkoutCard
